      out.write("                <script type=\"text/javascript\">\n");
      out.write("                    /**\n");
      out.write("                     * Funcion que se ejecuta cada vez que se añade una letra en un cuadro de texto\n");
      out.write("                     * Suma los valores de los cuadros de texto\n");
