      out.write("\n");
      out.write("                    /**\n");
      out.write("                     * Funcion para verificar los valores de los cuadros de texto. Si no es un\n");
      out.write("                     * valor numerico, cambia de color el borde del cuadro de texto\n");
      out.write("                     */\n");
      out.write("                    function verificar(id)\n");
      out.write("                    {\n");
      out.write("                        var obj = document.getElementById(id);\n");
      out.write("                        if (obj.value == \"\")\n");
      out.write("                            value = \"0\";\n");
      out.write("                        else\n");
      out.write("                            value = obj.value;\n");
      out.write("                        if (validate_importe(value, 1))\n");
      out.write("                        {\n");
      out.write("                            // marcamos como erroneo\n");
      out.write("                            obj.style.borderColor = \"#808080\";\n");
      out.write("                            return value;\n");
      out.write("                        } else {\n");
      out.write("                            // marcamos como erroneo\n");
      out.write("                            obj.style.borderColor = \"#f00\";\n");
      out.write("                            return 0;\n");
      out.write("                        }\n");
      out.write("                    }\n");
      out.write("\n");
      out.write("                    /**\n");
      out.write("                     * Funcion para validar el importe\n");
      out.write("                     * Tiene que recibir:\n");
      out.write("                     *  El valor del importe (Ej. document.formName.operator)\n");
      out.write("                     *  Determina si permite o no decimales [1-si|0-no]\n");
      out.write("                     * Devuelve:\n");
      out.write("                     *  true-Todo correcto\n");
      out.write("                     *  false-Incorrecto\n");
      out.write("                     */\n");
      out.write("                    function validate_importe(value, decimal)\n");
      out.write("                    {\n");
      out.write("                        if (decimal == undefined)\n");
